legend({'First Derivative','Height/100 (nm)', 'Second Derivative*10'},'FontSize',26);

%% curvature array

% curv_arr: Determine the curvature of the data at each extrema point
% (min/max identification purposes) using the second derivative array

curv_arr = zeros(size(SData_extr_pos));
num_max = 0; % Tracking the number of maximums
num_min = 0; % Tracking the number of minimums
for i = 1:length(SData_extr_pos)
    [curmmSData_x curmmSData_x_i] = closestDiscrete(SData_extr_pos(i),mmSData_x); %Readjust closest discrete x-value and index
    curddSData_y = ddSData_y(curmmSData_x_i);
    if curddSData_y > 0 % If minimum (second derivative is > 0), set curv_arr(i) = 1
        curv_arr(i) = 1;
        num_min = num_min + 1;
    elseif curddSData_y < 0 % If maximum (second derivative is < 0), set curv_arr(i) = -1
        curv_arr(i) = -1;
        num_max = num_max + 1;
    end
end

%% min/max identification

SData_max_pos = zeros(1,num_max); % Positions of maximums in real-space
SData_min_pos = zeros(1,num_min); % Positions of minimums in real-space

min_ind = 1; % Index of min position array
max_ind = 1; % Index of max position array
for i = 1:length(curv_arr)
    if curv_arr(i) == 1 % If curving down, append to minimum arrays and extend min index by 1
        SData_min_pos(min_ind) = SData_extr_pos(i);
        min_ind = min_ind + 1;
    elseif curv_arr(i) == -1 % If curving up, append to maximum arrays and extend max index by 1
        SData_max_pos(max_ind) = SData_extr_pos(i);
        max_ind = max_ind + 1;
    end
end

%% max indexes on data-array

% Due to discrepancies between real x-space and discrete x-values in the
% array, identify the closest x-values of each of the maximums

for i = 1:length(SData_max_pos)
    [SData_max(i) SData_maxi(i)] = closestDiscrete(SData_max_pos(i),SData_x);
end

%% min indexes on data-array

% Due to discrepancies between real x-space and discrete x-values in the
% array, identify the closest x-values of each of the minimums

SData_min = zeros(1,length(SData_max_pos)-1);
SData_mini = zeros(1,length(SData_max_pos)-1);
for i = 1:length(SData_maxi)-1
    [SData_min(i) SData_mini(i)] = min(SData_y(SData_maxi(i):SData_maxi(i+1)));
    SData_mini(i) = SData_mini(i) + SData_maxi(i);
end

%% Left/Right Inflection at each max for SData

[mmSData_Inf mmSData_Inf_i] = findZeros(smooth(ddSData_y), mmSData_x);

SData_Inf = zeros(size(mmSData_Inf));
SData_Inf_i = zeros(size(mmSData_Inf_i));

for i = 1:length(mmSData_Inf)
    [SData_Inf(i) SData_Inf_i(i)] = closestDiscrete(mmSData_Inf(i), SData_x);
end

scatter(SData_Inf,zeros(size(SData_Inf)),'kd','MarkerFaceColor','g');

total_curv = zeros(1,length(SData_Inf)-1);

num_trough = 0;
num_crest = 0;

for i = 1:length(SData_Inf)-1
    if mean(ddSData_y(SData_Inf_i(i):SData_Inf_i(i+1))) > 0
        total_curv(i) = 1;
        num_trough = num_trough + 1;
    elseif mean(ddSData_y(SData_Inf_i(i):SData_Inf_i(i+1))) < 0
        total_curv(i) = -1;
        num_crest = num_crest + 1;
    end
end

% Set up new curvature array. Take mean of each section. If positive or
% negative in those regions, then assume minimum or maximum ROC surface

%% Radii of Curvature fits

SData_RoCrEx = zeros(1,length(SData_Inf_i) - 1);
SData_RoCaEx = zeros(1,length(SData_Inf_i) - 1);
SData_RoCbEx = zeros(1,length(SData_Inf_i) - 1);
DoubleRoCleastsq = 0;

figure;
for i = 1:length(SData_Inf_i) - 1
    [SData_RoCrEx(i) SData_RoCaEx(i) SData_RoCbEx(i)] = radiusofcurv(SData_x(SData_Inf_i(i):SData_Inf_i(i+1)),SData_y(SData_Inf_i(i):SData_Inf_i(i+1)));
    c = scatter(SData_x(SData_Inf_i(i):SData_Inf_i(i+1)),SData_y(SData_Inf_i(i):SData_Inf_i(i+1)),49,'ks','MarkerFaceColor',[0 0 0]);
    hold on;
    
    if total_curv(i) == -1
        circeval = sqrt(SData_RoCrEx(i).^2 - (SData_x(SData_Inf_i(i):SData_Inf_i(i+1)) - SData_RoCaEx(i)).^2) + SData_RoCbEx(i);
        d = plot(SData_x(SData_Inf_i(i):SData_Inf_i(i+1)),circeval,'b','LineWidth',3);
    else
        circeval = -sqrt(SData_RoCrEx(i).^2 - (SData_x(SData_Inf_i(i):SData_Inf_i(i+1)) - SData_RoCaEx(i)).^2) + SData_RoCbEx(i);
        d = plot(SData_x(SData_Inf_i(i):SData_Inf_i(i+1)),circeval,'b','LineWidth',3);
    end
    
    DoubleRoCleastsq = DoubleRoCleastsq + sum(abs(circeval - SData_y(SData_Inf_i(i):SData_Inf_i(i+1))).^2);
    pause(0.1);
end

set(gcf,'Position',[0 0 1200 900]);
set(gca,'FontName','Arial','FontSize',25);
xlabel('Distance (nm)','FontSize',30,'FontName','Arial');
ylabel('Height (nm)','FontSize',30,'FontName','Arial');
legend([c d], {'AFM Data','Curvature Fit'},'FontName','Arial','FontSize',25);

%% Compiling Values

trough_ROC = zeros(1,num_trough);
crest_ROC = zeros(1,num_crest);
trough_widths = zeros(1,num_trough);
crest_widths = zeros(1,num_crest);

trough_ind = 1;
crest_ind = 1;
for i = 1:length(total_curv)
    if total_curv(i) == 1
        crest_ROC(crest_ind) = SData_RoCrEx(i);
        crest_widths(crest_ind) = SData_x(SData_Inf_i(i+1)) - SData_x(SData_Inf_i(i));
        crest_ind = crest_ind + 1;
    elseif total_curv(i) == -1
        trough_ROC(trough_ind) = SData_RoCrEx(i);
        trough_widths(trough_ind) = SData_x(SData_Inf_i(i+1)) - SData_x(SData_Inf_i(i));
        trough_ind = trough_ind + 1;
    end
end

avg_trough_ROC = mean(trough_ROC);
stdev_trough_ROC = sqrt(var(trough_ROC));
avg_crest_ROC = mean(crest_ROC);
stdev_crest_ROC = sqrt(var(crest_ROC));

avg_trough_width = mean(trough_widths);
stdev_trough_width = sqrt(var(trough_widths));
avg_crest_width = mean(crest_widths);
stdev_crest_width = sqrt(var(crest_widths));
avg_total_width = avg_trough_width + avg_crest_width;
stdev_total_width = sqrt(stdev_trough_width^2 + stdev_crest_width^2);